import Moment from 'react-moment';

import { getIcon } from '../../utils/weatherHelper';
import { capitalize } from '../../utils/stringHelper';

const Daily = ({ daily }) => {
  console.log(daily)
  return (
    <div>
      {
        daily.map((day, idx) => {
          const datetime = new Date(day.dt);
          return (
            <div key={idx}>
              <div>
                <img src={getIcon(day.weather[0].icon)} alt={day.weather[0].description} />
              </div>
              <div>
                <p>Temp: {Math.floor(day.temp)}</p>
                <small>Feels like: {Math.floor(day.feels_like)}</small>
              </div>
              <div>
                <p>Weather: {`${capitalize(day.weather[0].description)}`}</p>
              </div>
              <small>{day.dt}</small>
            </div>
          )
        })
      }
    </div>
  )
}

export default Daily;
